import React from 'react';
import { Link } from 'react-router-dom';
import './AITestingTools.css';

const aiTestingTools = [
  { name: 'KushoAI', description: '使用AI在几分钟内测试后端流程。', link: '/ai-testing-tools/kushoai', image: 'https://kusho.ai/logo.png' },
  { name: 'Claude Computer Use', description: 'Anthropic公司开发的AI工具，用于自动化操作。', link: '/ai-testing-tools/claude-computer-use', image: 'https://www.anthropic.com/images/logo.svg' },
  { name: 'TableSprint', description: '一个AI平台，用于构建面向未来的应用程序。', link: '/ai-testing-tools/tablesprint', image: 'https://tablesprint.com/logo.png' },
  { name: 'FocusBuddy', description: '一个始终在线的AI执行助手。', link: '/ai-testing-tools/focusbuddy', image: 'https://focusbuddy.ai/logo.png' },
  { name: 'AssemblyAI', description: '一个多语言语音转文本API，具有超人的准确性。', link: '/ai-testing-tools/assemblyai', image: 'https://www.assemblyai.com/logo.svg' },
  // ... 其他工具
];

function AITestingTools() {
  return (
    <div className="ai-testing-tools">
      <div className="tool-grid">
        {aiTestingTools.map((tool, index) => (
          <Link to={tool.link} key={index} className="tool-card-link">
            <div className="tool-card">
              <img src={tool.image} alt={tool.name} className="tool-logo" />
              <h3>{tool.name}</h3>
              <p>{tool.description}</p>
            </div>
          </Link>
        ))}
      </div>
    </div>
  );
}

export default AITestingTools;
